import classes from "./ClothesSummary.module.css";

const ClothesSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Fashion Clothes with the best price</h2>
      <p>
        Choose the best clothes from our broad selection of available clothes
        and feel as much gorgeous as you already are..
      </p>
      <p>
        All our clothes are made with high-quality material, so you can look
        nice and comfortable!
      </p>
    </section>
  );
};

export default ClothesSummary;
